import * as React from 'react';
interface MenuItem {
  key: string;
  label: string;
}
const MenuItems = [
  {
    key: 'aboutMe',
    label: 'About me'
  },
  {
    key: 'projects',
    label: 'Projects'
  }
];
const LayoutHeader: React.FC<{}> = () => {
  return (
    <div className={'layout-Header'}>
      {MenuItems.map(item => (
        <span key={item.key} className={'layout-header-menu-items'}>
          {item.label}
        </span>
      ))}
      <style jsx>
        {`
          @import '../pages/common.less';
          .layout-header-menu-items {
            line-height: 32px;
            font-family: 'Sofia Pro Bold', 'Sofia Pro', Serif;
            font-style: italic;
            color: @main-color;
          }
        `}
      </style>
    </div>
  );
};

export default LayoutHeader;
